import React from 'react';
import '../App.css';
import api from "../actions/api.js";

class Users extends React.Component {

    usersLists(){
        console.log(api.registerUser().fetchAll().then(res => {
            return res.data.filter( user => user.email!==localStorage.getItem('userEmail'))
        }))
    }

    render (){
        if(localStorage.getItem('userEmail')){
            api.registerUser().fetchAll().then(res => {
                const user=res.data.filter( user => user.email!==localStorage.getItem('userEmail'))
            
                return (<td class="tableTh">{user.email}</td>)

            });
        }
    }
}

export default Users;
